import type { Meta, StoryObj } from '@storybook/react';
import React from "react";
import AppWithRedux from "../AppWithRedux";
import { Provider } from "react-redux";
import { store } from "../state/store";

// More on how to set up stories at: https://storybook.js.org/docs/react/writing-stories/introduction#default-export
const meta: Meta<typeof AppWithRedux> = {
  title: 'TODOLISTS/AppWithRedux',
  component: AppWithRedux,
  // This component will have an automatically generated Autodocs entry: https://storybook.js.org/docs/react/writing-docs/autodocs
  tags: ['autodocs'],
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {}
};
export default meta;
type Story = StoryObj<typeof AppWithRedux>;

// More on writing stories with args: https://storybook.js.org/docs/react/writing-stories/args
export const EditableSpanStory: Story = {
  render: args => <Provider store={store}><AppWithRedux /></Provider>
};
EditableSpanStory.parameters = {
  ...EditableSpanStory.parameters,
  docs: {
    ...EditableSpanStory.parameters?.docs,
    source: {
      originalSource: "{\n  render: args => <Provider store={store}><AppWithRedux /></Provider>\n}",
      ...EditableSpanStory.parameters?.docs?.source
    }
  }
};
